import React from 'react';

const Header = (props) => {
    return (
        <div>
            I want a
            <select
                name={"seBooks"}
                id={"seBooks"}
                onChange={props.handler("iiio")}>
                <option value={0}>Fiction</option>
                <option value={1}>Non-Fiction</option>
            </select>
            Best-selling book
        </div>
    );
};

export default Header;
